import styled from 'styled-components'


export const ContainerPai= styled.div`
display: flex;
position: absolute;
align-items: center;
justify-content: center;
text-align: center;
width: 100%;
margin: 0 auto;
height: 1vh;
top:40px;
`
export const TituloPrincipal= styled.h1`
display: flex;
text-align: center;
color:#070809;
font-size: 2.3rem;
font-weight: 700;
`
export const Imagem=styled.span`
width: 10%;
`
